INSERT INTO `topics` VALUES ('1551855789033', '谷歌开发者大会', '553', 'https://user-gold-cdn.xitu.io/2018/9/19/165eff0a6d839c83?imageView2/1/w/200/h/200/q/85/interlace/1', '谷歌开发者大会（Google Developer Days，简称 GDD）是展示 Google 最新开发者产品和平台的全球盛会。你可以在这里发布、了解最新的大会信息~', '2019-03-30 17:59:40.578141', '32');
INSERT INTO `topics` VALUES ('1551855789034', '求职中', '552', 'https://user-gold-cdn.xitu.io/2018/12/29/167f895de55ecd98?imageView2/1/w/200/h/200/q/85/interlace/1', '在这里发布你的求职信息，包括：\n必要：工作年限、求职领域、会的技能点；\n选填：项目经历、年龄、教育背景；\n（话题下不符合话题要求的沸点将被移除，如果找到满意的工作记得删掉求职沸点哟~~）', '2019-03-21 16:54:00.441977', '33');
INSERT INTO `topics` VALUES ('1551855789035', '年终总结', '552', 'https://user-gold-cdn.xitu.io/2018/12/3/167716e00c55522c?imageView2/1/w/200/h/200/q/85/interlace/1', '一年又要结束了，年初的小目标完成的怎么样啦？\n\n参考格式：\n- 用 1 个句话概括即将过去的 2018 年，eg：GitHub 绿了 365 天…或者用 3 个关键词概括一年，eg：#脱单#、#加薪#、#离职#…\n- 展开描述一年总结', '2019-03-21 16:53:56.697061', '34');
INSERT INTO `topics` VALUES ('1551855789036', 'Google IO', '553', 'https://user-gold-cdn.xitu.io/2018/5/3/16324238af34ba06?imageView2/1/w/200/h/200/q/85/interlace/1', '2018年 Google IO 就要来了，你感觉又会发布哪些新技术，哪些新的技术方向？', '2019-04-04 09:21:35.483276', '35');
INSERT INTO `topics` VALUES ('1551855789037', '掘金前端小组', '553', 'https://user-gold-cdn.xitu.io/2018/12/11/1679b81bcaa2c98d?imageView2/1/w/200/h/200/q/85/interlace/1', '本话题主理人为：@yck\n\n在这个话题下：\n1. 分享自己不知道如何解决的前端问题\n2. 分享前端的小知识点\n3. 分享前端面试经历与面试题\n4. 分享前端最新的技术动态，比如 Vue、React 框架动态\n5. 分享有趣好玩的前端梗', '2019-03-23 10:53:56.332317', '36');
INSERT INTO `topics` VALUES ('1551855789038', '掘金开发者大会', '553', 'https://user-gold-cdn.xitu.io/2018/8/8/16518adb76ace294?imageView2/1/w/200/h/200/q/85/interlace/1', '掘金开发者大会 · 微信小程序专场将于9月16日在北京富力万丽酒店举行，目前早鸟票在限时优惠中~', '2019-03-30 16:31:23.865556', '37');
INSERT INTO `topics` VALUES ('1551855789039', '进击的 React', '552', 'https://user-gold-cdn.xitu.io/2018/12/21/167cee49ac013efa?imageView2/1/w/200/h/200/q/85/interlace/1', '本话题主理人为：程墨\n\n在这个话题下，你可以进行 React 技术及前端开发的前沿讨论与资讯分享。', '2019-03-21 16:53:38.578526', '38');
INSERT INTO `topics` VALUES ('1551855789040', '好文推荐', '552', 'https://user-gold-cdn.xitu.io/2018/12/21/167d075b19a7367a?imageView2/1/w/200/h/200/q/85/interlace/1', '在这里分享你发现的优质掘金文章 & 其他平台文章，可以自荐，所有沸点在发布后 24 小时没能获得 3 个点赞将会从话题下移除，但原内容保留(≧▽≦)', '2019-03-21 16:53:34.866866', '39');
INSERT INTO `topics` VALUES ('1551855789041', 'WWDC', '553', 'https://user-gold-cdn.xitu.io/2018/5/16/1636829c1b1ada64?imageView2/1/w/200/h/200/q/85/interlace/1', 'WWDC - 苹果全球开发者大会，是苹果公司每年定期在美国加州举办的会议活动，主要目的是向该公司产品的相关软件的设计师们展示最新的软件和技术。', '2019-04-04 09:21:17.255548', '40');
INSERT INTO `topics` VALUES ('1551855789042', 'LC3-2018', '552', 'https://user-gold-cdn.xitu.io/2018/6/21/16421062e9cb22c3?imageView2/1/w/200/h/200/q/85/interlace/1', 'LC3 会议覆盖了开源界讨论最多、研究范围最广、实践探索最前沿的热点话题。', '2019-03-21 16:53:22.648020', '41');

